import { Schema, model } from 'mongoose'

const productSchema = new Schema({
    name: String,
    price: Number,
    category: String,
    subCategory: String,
    stock: Number,
    imgUrl: String
},
    {
        timestamps: true,
        versionKey: false
    })

export default model('Product', productSchema)
